import React from 'react';
class Card extends React.Component{
    render(){
        return (
         <div className="card">
             <div className="row">
                <div className="col-2">
                    Netflix Account
                </div>
                <div className="col-2">
                   <Button>$21</Button>
                </div>
             </div>
             <div>
              Progress bar goes here!
             </div>
        </div>
        );
    }
}
